import React from 'react'

const Register = () => {
  return (
      <div className='container'>
        <form className='form App-header'>
           <label> Name</label> 
           <input 
                type="text" 
                name='Fname'
                value = {Fname}
                placeholder='Fname'
                onChange={(e)=> onChange(e)} 
            />
            <label> Email</label>
            <input 
                type="text" 
                name='email'
                value = {email}
                placeholder='Email'
                onChange={(e)=> onChange(e)} 
            /> 
            <label> Password </label>
            <input 
                type="password" 
                name='password'
                value = {password}
                placeholder='Password'
                onChange={(e)=> onChange(e)} 
            />
             <label> Re-type Password </label>
            <input 
                type="password" 
                name='password2'
                value = {password2}
                placeholder='Repeat Password'
                onChange={(e)=> onChange(e)} 
            />

        </form>
      </div>
  );
}

export default Register;
